                        <div class="slide__text">
                            <h2 class="slide__text-heading">Ladakh</h2>
                            <p class="slide__text-desc">Ladakh, the land of jagged peaks and barren landscape is alluring and awe-inspiring. Hidden behind this harsh and forbidding façade is an ancient civilization and captivating people. Beyond the old frontiers lies the land of wilderness with its unaltered character and overwhelming natural beauty beckoning the more intense and adventurous of travelers. This awesome wildness and magic belongs to that great land of towering mountains and Buddhist simplicity-Ladakh.</p>
