                        <path class="slide__overlay-path" d="M0,0 150,0 500,405 0,405" />
                    </svg>
                        <div class="slide__text">
                            <h2 class="slide__text-heading">Dal Lake</h2>
                            <p class="slide__text-desc">Dal Lake is, initially, one of the most confusing parts of Srinagar for it's not really one lake at all, but three. Further more much of it is hardly what one would expect a lake to be like - it's a maze of intricate waterways and channels, floating islands of vegetation, houseboats that look so firmly moored they could almost be islands and hotels on islands which look like they could simply float away. </p>
        
