                        </svg>
                        <div class="slide__text">
                        <h2 class="slide__text-heading">Pangong Tso</h2>
                        <p class="slide__text-desc">Do you remember the last scene of 3 idiots? Want to know about the location where Aamir Khan and Kareena Kapoor were snogging in the last scene? For those who are besotted by the background that acted as a catalyst for Kareena Kapoor’s love confession, the place is located in Ladakh. Situated at a height of 4,250 meters, far away in barren land in Ladakh, Pangong Tso is one of the largest brackish lakes in Asia. The crystal clear blue lake sprawls over an area of 100 kilometers across the borders of two countries in India and China. It is one of the charismatic lakes situated on the Changtang plateau in eastern Ladakh region.</p>
