			  <h1 class="shead-style text-center" style="font-size: 4em;">JAMMU & KASHMIR</h1>
        <p>Sitting on the Himalayas , it houses all kind of diversity nature has. Also known as Heaven in earth It is a abode of all that is finest among natures creations. The mesmerizing beauty of Kashmir is in a way can’t ever be explained in words. Mostly sparse and very lightly popoulated it is also very different in its distribution.</p>
        <p>The Ladakh region is the least populated and consists of dry cold deserts. Biking in the roads of Ladakh is very popoular among travelers. The Kasmir region consists of green mountains , grass lands , valleys and rivers which are integral part of the beauty. As a whole Kashmir offers a complete adventure any traveler wants.
